const frogsData  = require('../data/frogsData.json');
function frogs(){
    let frogs = [];
    for(let f in frogsData){
        console.log(f);
        let img = require(frogsData[f]['image'])
        let frogCleanse = {
            'id': frogsData[f]['id'],
            'name': frogsData[f]['name'],
            "image": img
        }
        frogs.push(frogCleanse);
    }
    
    return frogs;
}
export default frogs;
